import React, { useState } from 'react';

const RichiestaForm = ({ utente }) => {
  const [formData, setFormData] = useState({
    categoria: '',
    regione: '',
    comune: '',
    descrizione: '',
    media_url: ''
  });

  const [message, setMessage] = useState('');

  const handleChange = e => {
    const { name, value } = e.target;
    setFormData(prev => ({ ...prev, [name]: value }));
  };

  const handleSubmit = async e => {
    e.preventDefault();
    setMessage('✅ Dati ricevuti:\n' + JSON.stringify(formData, null, 2));
  };

  return (
    <form onSubmit={handleSubmit} style={{ maxWidth: '500px', margin: '2rem auto' }}>
      <h2>Modulo Test Richiesta</h2>

      <label>Categoria:</label><br />
      <input type="text" name="categoria" onChange={handleChange} value={formData.categoria} required /><br /><br />

      <label>Regione:</label><br />
      <input type="text" name="regione" onChange={handleChange} value={formData.regione} required /><br /><br />

      <label>Comune:</label><br />
      <input type="text" name="comune" onChange={handleChange} value={formData.comune} required /><br /><br />

      <label>Descrizione:</label><br />
      <textarea name="descrizione" onChange={handleChange} value={formData.descrizione} required /><br /><br />

      <label>Immagine URL:</label><br />
      <input type="text" name="media_url" onChange={handleChange} value={formData.media_url} /><br /><br />

      <button type="submit">Invia</button>
      <p style={{ whiteSpace: 'pre-line' }}>{message}</p>
    </form>
  );
};

export default RichiestaForm;
